  const handleViewCalendar = () => {
    // Add functionality for viewing calendar
  };

  const handleViewDocument = () => {
    // Add functionality for viewing documents
  };

  const handleViewTask = () => {
    // Add functionality for viewing tasks
  };

  return (
    <div>
      <Header />
      <div className="container">
        <div className="dashboard-container">
          <h1>Cartotrac Intranet</h1>
          <button onClick={handleLogout}>Déconnexion</button>
          <div className="dashboard-options">
            <button onClick={handleEmployeeList}>Liste des utilisateurs</button>
            <button onClick={handleViewProfile}>Voir mon profil</button>
            <button onClick={handleViewMessage}>Voir les messages</button>
            <button onClick={handleViewCalendar}>Voir le calendrier</button>
            <button onClick={handleViewDocument}>Voir les documents</button>
            <button onClick={handleViewTask}>Voir les tâches</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
